title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o2427.m39 -> o2424.m33 -> o2427.m39
  o2427.m29 -> o2424.m16 -> o2424.m36 -> o2427.m29
  o2424.m16 -> o2424.m36 -> o2427.m29 -> o2424.m16
  o2424.m33 -> o2427.m39 -> o2424.m33
  o2424.m38 -> o2424.m36 -> o2427.m29 -> o2424.m16 -> o2424.m36
  o2424.m36 -> o2427.m29 -> o2424.m16 -> o2424.m36
  o2427.m22 -> o2424.m38 -> o2424.m36 -> o2427.m29 -> o2424.m16 -> o2424.m36

features:
  - inheritance
  - overriding
  - method
  - polymorphism

